import { useHistory, useParams } from "react-router-dom";
import '../../Css/GroupItem.css';
import groupItem_image from '../../img/groupItem_image.jpg';
import groupItem_image1 from '../../img/groupitem_image1.PNG';
import groupItem_image2 from '../../img/groupitem_image2.jpg';
import groupItem_image3 from '../../img/groupitem_image3.jpg';
import groupItem_image4 from '../../img/groupitem_image4.png';
import React from 'react';
import axios from 'axios';

function GroupItemDetail(props) {
    return (
        <div>
            <h1 id="groupItem_header">구호물품 공동구매</h1>
            <div id="groupItem_main">
                <div id="groupItem_view">
                    <div id="groupItem_view_header">
                        <div id="donation_list">
                            <div class="groupItem_list_content">신상품순</div>
                            <div class="groupItem_list_content">|</div>
                            <div class="groupItem_list_content">찜개수 순</div>
                            <div class="groupItem_list_content">|</div>
                            <div class="groupItem_list_content">마감전순</div>
                        </div>
                    </div>
                 
                </div>
            </div>
        </div>
      );

  
}

export default GroupItemDetail;
